## Class as parameters

> For class as parameter class should be construct from initializer list of class members and has default constructor

```cpp
class Point_2d {
public:
  int x;
  int y;

  Point_2d();
  Point_2d(const int& x, const int& y);
}


void set_abs_by_ref(Point_2d& point) {
   if (point.x < 0) {
       point.x = -1 * point.x;
   }
   if (point.y < 0) {
       point.y *= -1;
   }
